import React, { Component } from 'react';
import ListOfJobs from './ListOfProjs';

class Project extends Component {
	
	constructor(props){
		super(props);
		this.state = {
			projs: []
		}
	}
	
	componentDidMount() {
		this.setState({projs: this.props.projvals});
	}
	
	render() {
		return(
			<div>
				<ListOfProjs projs={this.state.projs} />
			</div>
			);
	}
}

export default Project;
